import React, { Component } from "react";

class TitanClass extends Component {
  render() {
    return;
    <div>
      <h1>Class Component {this.props.name}</h1>
      <h2>Class Component call {this.props.titanName}</h2>
    </div>;
  }
}

export default TitanClass;
